}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 16 16" xml:space="preserve">	<path fill="#464646" d="M16,16H0V0h16V16z"/><rect x="1" y="1" fill="#3C91AF" width="14" height="14"/>	<path fill="#147391" d="M14,6H2v4h12V6L14,6z"/><polyline fill="#FFFFFF" points="13,7 13,9 3,9 3,7 13,7 "/></svg>';
